import React from "react";

const Services = () => {
  return (
    <section className="services section" id="services">
      <h2 className="section__title">Our Expertise</h2>
      <span className="section__subtitle">Expertise at Your Service</span>
      <div className="services__container conatiner grid">
        <div className="services__content">
            <div>
                <i className="uil uil services"></i>

                <h3 className="services__title"></h3>
            </div>

            span.services__button
        </div>
      </div>
    </section>
  );
};

export default Services;
